import axios from "axios";
import { useEffect, useState } from "react";


const ShowAll =(props)=>
{

    const [characterCollection, setcharacterCollection] = useState([]);

    useEffect(()=>{
        axios.get("http://localhost:8000/api/showAll")
        .then((res)=>{
            console.log(res);
            console.log(res.data);
            setcharacterCollection(res.data);
        })
        .catch((err)=>console.log(err))
    })

    return (
        <>
            <h1>ANIME CHARACTER LIST</h1>
            <hr/>
            {
                characterCollection && 
                characterCollection.map()
            }
        </>
    )
}

export default ShowAll;
